ALTER DEFAULT PRIVILEGES IN SCHEMA public GRANT ALL ON TABLES TO connectdb;
ALTER DEFAULT PRIVILEGES IN SCHEMA public GRANT USAGE, SELECT, UPDATE ON SEQUENCES TO connectdb;